    'Duffing oscillator': `{"R":{"rayBatch":53,"maxTimeSteps":760,"maxIterations":100,"integrationTime":200,"integrateForward":true,"gridSpace":0,"tubeWidth":0.0015509219369291747,"tubeSpread":false,"record_realtime":true,"xmin":-1.0181548906631752,"xmax":0.9818451093368248,"ymin":-0.46395953999758,"ymax":-0.09391065308082513,"zmin":7.990777471094592,"zmax":8.047732817744803,"clipToBounds":false,"showBounds":false,"exposure":-1.7476732161323678,"gamma":0.8407445708376422,"contrast":0.9731127197518097,"saturation":1.4364012409513962,"subtractiveColor":false,"bgColor":[0,0,0],"hairShader":true,"specShine":90.88402550404963,"specColor":[0.1568627450980392,0.1568627450980392,0.1568627450980392],"light1_color":[1,0.9,0.8],"light2_color":[0.8,0.9,1],"light1_dir":[0.5773502691896258,0.5773502691896258,0.5773502691896258],"light2_dir":[-0.5773502691896258,-0.5773502691896258,-0.5773502691896258],"depthTest":true,"dash_spacing":0.033884875653742756,"dash_speed":11.83069845154511,"dash_size":0.47496841969769565,"dashes":false,"subtractive_color":false,"hairShine":10,"hairSpecColor":[1,1,1]},"C":{"pos":[-2.1108494346557003,0.19233348794412808,12.495564463894643],"tar":[-0.33528032697244214,-0.0021237020873883564,9.69214160719262],"near":0.03464101615137755,"far":34641.016151377546},"E":{"code":"\\n///////////////////////////////////////////\\n// Duffing oscillator\\n///////////////////////////////////////////\\n\\n// https://en.wikipedia.org/wiki/Duffing_equation\\n\\n/* To visualize the long-time behaviour,\\n   it is convenient to have the z-coordinate correspond to:\\n   \\n           stretch * t/(t+1)\\n  \\n  so the solution curves asymptote to z=stretch\\n  as t goes to infinity. This implies:\\n  \\n     dz/dt = (stretch-z)^2 / stretch\\n     \\n   and \\n   \\n      t = z/(stretch-z)\\n*/\\n\\nconst float alpha = -1.0;\\nconst float beta  = 1.0;\\nconst float gamma = 0.37;\\nconst float delta = 0.3;\\nconst float omega = 1.2; \\n\\n#define rgb vec3\\n\\nfloat F(float t)\\n{\\n   return gamma*cos(omega*t);\\n}\\n  \\nconst vec3 colLo = rgb(254,45,73) / 255.0;\\nconst vec3 colHi = rgb(5,138,255) / 255.0;\\nconst float magScale = float(90.177512365778);\\nconst float stretch = 10.0;\\n\\n vec3 velocity(vec3 p, float t)\\n {\\n     vec3 v;\\n     float x = p.x;\\n     float y = p.y;\\n     float z = p.z;\\n   \\t float S = (stretch-z);\\n   \\t float tau = z/S;\\n     v.x = y;\\n     v.y = -alpha*x - beta*x*x*x - delta*y + F(tau);\\n     v.z = S*S/stretch;\\n     return v;\\n }    \\n \\nvec3 color(vec3 p, float t)\\n{\\n  \\tfloat mag2 = t/magScale;\\n    float lerp = mag2/(1.0 + mag2);\\n    return lerp*colLo + (1.0-lerp)*colHi;\\n}  \\n\\n\\n\\n"}}`,

